import { useRef, useState } from "react";
import "./LogInStyle.css";
import ButtonLogIn from "./buttonLogIn";

const LogIn = () => {
  const [dataa, setDataa] = useState(null);
  const emailRef = useRef();
  const passwdRef = useRef();
  const authSubmitHandler = async (event) => {
    event.preventDefault();
    const logInData = {
      email: emailRef.current.value,
      password: passwdRef.current.value,
    };
    console.log(logInData.email + " " + logInData.password);
    try {
      const responseData = await fetch(
        process.env.REACT_APP_BACKEND_URL + "employee/login",
        {
          method: "POST",
          body: JSON.stringify(logInData),
          headers: {
            "Content-Type": "application/json",
          },
        }
      );
      setDataa(responseData);
      console.log(responseData)
    } catch (err) {
      console.log("mamchetech el check mta el login" + err);
    }
  };

  return (
    <div>
      <header>
        <table className="nav">
          <tr>
            <th>
              {" "}
              <img alt="" className="logo" src="images/oyemkemlavert.png" />
            </th>
            <th className="accueil">Accueil</th>
          </tr>
        </table>
      </header>

      <section className="main">
        <p className="sign">Se Connecter</p>

        <table>
          <tr>
            <th>
              <img alt="" className="image" src="images/oyemvertblanc.jpg" />
            </th>
            <th>
              <form className="form1" />
              <input
                className="email "
                name="email"
                type="email"
                align="center"
                placeholder="Email"
                ref={emailRef}
              />

              <div>
                <input
                  className="pass"
                  type="password"
                  align="center"
                  placeholder="Mot De Passe"
                  ref={passwdRef}
                />
              </div>

              <a
                href="/"
                className="submit"
                onClick={authSubmitHandler}
                align="center"
              >
                Se Connecter
              </a>

              <ButtonLogIn myData={dataa} />
              <br />
              <br />

              <div>
                <p className="forgot " align="center ">
                  <a alt="" href="Reset password ">
                    Mot De Passe Oubli√©?
                  </a>
                </p>
              </div>
            </th>
          </tr>
        </table>
      </section>
    </div>
  );
};

export default LogIn;
